import React, {Component} from "react";

export class Signup extends Component {
	state = {
		name: "",
		password: "",
	};

	handleSubmit = (event) => {
		event.preventDefault();
	};

	render() {
		return (
			<div>
				<h1>Please Sign up with your name and password!</h1>
				<form onSubmit={this.handleSubmit}>
					<label> Name: </label>
					<input type="text" />
					<label> Password: </label>
					<input type="password" />

					<input type="submit" />
				</form>
			</div>
		);
	}
}

export default Signup;
